import React from 'react';
import {TextField, Grid,Typography, Stack} from '@mui/material'
import LoginForm from './LoginForm';
/**
 *  Login Main Component
 * 
 */

const Login = () => {
    return(
        <Grid container spacing={2}>
            <Grid item xs = {1} md = {4}>
             <Typography
              variant = 'h6'
              >
                Fill your data to create an account
              </Typography>
             <Stack
              alignContent={'center'}
              sx = {{padding : 8}}
              >
              <LoginForm />
             </Stack>
            </Grid>
        </Grid>
    );
}

export default Login;
